import React from 'react';

/**
 * Componente de bienvenida que describe el objetivo del sistema.
 */
const Home = () => (
  <div>
    <h2>Bienvenido a Camaleon Bodega</h2>
    <p>
      Este sistema le permite gestionar su inventario, registrar ventas, pagos y
      proveedores, así como recibir notificaciones de bajo stock.  Use el
      menú superior para acceder a las distintas funciones según su rol.
    </p>
  </div>
);

export default Home;
